import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';

function App() {
  try {
    // Render the app content here
  } catch (error) {
    // Render the error page content here
  }

  return (
    <div>
      <Navbar>
        {/* Conditionally render the navigation links only if there is no error */}
        {!error && (
         <Navbar>
         <div className="container-fluid" id="menu">
             <Navbar.Brand><img src={logo} alt="" width="70"/></Navbar.Brand>
             <Navbar.Collapse className="justify-content-end">
                 <Navbar.Text>
                     <Nav className="me-auto">
                         <Nav.Link href="/">Home</Nav.Link>
                         <Nav.Link href="/about">About</Nav.Link>
                         <Nav.Link href="/cases">Cases</Nav.Link>
                         <Nav.Link href="/contact">Contact</Nav.Link>
                     </Nav>
                 </Navbar.Text>
             </Navbar.Collapse>
         </div>
     </Navbar>

        )}
        </Navbar>
      {/* App content or error page content goes here */}
    </div>
  );
}

export default App;
